contracts/Factory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Base.sol";
import "./Registry.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

contract Factory is Ownable, Registry{
    BaseToken immutable base;

    constructor(){
        BaseToken baseToken = new BaseToken();
        base = baseToken;
        BaseToken(baseToken).initialize(0, address(this), "Base", "BASE");
    }

    function createToken(uint256 nftID, uint256 supply, address _owner) external onlyOwner {
        BaseToken newToken = BaseToken(Clones.cloneDeterministic(address(base), keccak256(abi.encodePacked(nftID))));

        bytes memory name = abi.encodePacked(bytes("NFT: "), nftID);
        bytes memory symbol =  abi.encodePacked(bytes("NFT-"), nftID);

        setTokenAddress(nftID, address(newToken));    

        newToken.initialize(supply, _owner, string(name), string(symbol));


    }
}

contracts/Registry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Registry {
    // NFT ID => token address
    mapping(uint256=>address) internal tokenRegister;

    function getTokenAddress(uint256 nftID) external view returns(address){
        return tokenRegister[nftID];
    }

    function setTokenAddress(uint256 nftID, address token) internal{
        require(tokenRegister[nftID] == address(0), "token already exists");
        require(token != address(0), "token address invalid");
        tokenRegister[nftID] = token;
    }
}

